import React, { useState, useEffect } from 'react';
import { fetchExecutionDetailsGrouped, updateExecutionDetails } from '../services/api';

const ExecutionDetailsPage = () => {
  const [executions, setExecutions] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const loadExecutions = async () => {
      try {
        const data = await fetchExecutionDetailsGrouped();
        setExecutions(data);
      } catch (err) {
        console.error('❌ Error fetching execution details:', err);
      } finally {
        setLoading(false);
      }
    };

    loadExecutions();
  }, []);

  const handleUpdate = async (executionId, field, value) => {
    try {
      await updateExecutionDetails(executionId, { [field]: value });
      setExecutions((prev) =>
        prev.map((exec) => (exec._id === executionId ? { ...exec, [field]: value } : exec))
      );
    } catch (err) {
      console.error('❌ Error updating execution detail:', err);
    }
  };

  return (
    <div className="container">
      <h2>Execution Management</h2>
      {loading ? (
        <p>Loading execution details...</p>
      ) : (
        <table border="1">
          <thead>
            <tr>
              <th>Process</th>
              <th>Vendor</th>
              <th>Line Item</th>
              <th>Order</th>
              <th>Weight Sent</th>
              <th>Actual Weight Sent</th>
              <th>Weight Received</th>
              <th>Actual Weight Received</th>
              <th>Date Sent</th>
              <th>Date Received</th>
              <th>Pieces Sent</th>
              <th>Pieces Received</th>
              <th>Status</th>
            </tr>
          </thead>
          <tbody>
            {executions.map((exec) => (
              <tr key={exec._id}>
                <td>{exec.processInfo?.name || exec.processId}</td>
                <td>{exec.vendorInfo?.name || exec.vendorId}</td>
                <td>{exec.lineItemId}</td>
                <td>{exec.orderId}</td>
                <td>{exec.outWeight}</td>
                <td>
                  <input
                    type="number"
                    value={exec.actualWeightSent || ''}
                    onChange={(e) => handleUpdate(exec._id, 'actualWeightSent', Number(e.target.value))}
                  />
                </td>
                <td>{exec.inWeight}</td>
                <td>
                  <input
                    type="number"
                    value={exec.actualWeightReceived || ''}
                    onChange={(e) => handleUpdate(exec._id, 'actualWeightReceived', Number(e.target.value))}
                  />
                </td>
                <td>{exec.dateSent}</td>
                <td>
                  <input
                    type="date"
                    value={exec.dateReceived || ''}
                    onChange={(e) => handleUpdate(exec._id, 'dateReceived', e.target.value)}
                  />
                </td>
                <td>{exec.piecesSent}</td>
                <td>
                  <input
                    type="number"
                    value={exec.piecesReceived || ''}
                    onChange={(e) => handleUpdate(exec._id, 'piecesReceived', Number(e.target.value))}
                  />
                </td>
                <td>
                  <select value={exec.status} onChange={(e) => handleUpdate(exec._id, 'status', e.target.value)}>
                    <option value="Pending">Pending</option>
                    <option value="In Progress">In Progress</option>
                    <option value="Complete">Complete</option>
                  </select>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      )}
    </div>
  );
};

export default ExecutionDetailsPage;
